import React from "react";
import { AppBar, Toolbar, Typography, Box, Tab, Tabs } from "@mui/material";

function Header() {
  return (
    <div>
      <AppBar position="static">
        <Toolbar>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
            MERN
          </Typography>
          <Box>
            <Tabs>
              <Tab label="Home" />
            </Tabs>
          </Box>
        </Toolbar>
      </AppBar>
    </div>
  );
}

export default Header;
